import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        <img src="" className="App-logo" alt="logo" />
        <p>
          Iniciar pedido
        </p>
      </header>
    </div>
  );
}

export default App;
